chrome.alarms.onAlarm.addListener(s=>{if(s.name.startsWith("funil_")){const[o,e,n]=s.name.split("_");chrome.storage.sync.get(["funnels"],c=>{const t=c.funnels||{};if(t[e]){const m=t[e];chrome.tabs.query({url:"https://web.whatsapp.com/*"},a=>{a.length>0&&chrome.tabs.sendMessage(a[0].id,{type:"SEND_FUNNEL_MESSAGE",contactId:e,messageIndex:parseInt(n),message:m.messages[n]})})}})}});
